INSERT INTO `templates` (`id`, `name`, `registered`, `type`, `system`, `filename`, `content`, `status`, `provider_template_id`, `provider_template_name`) VALUES
(1, 'Aviso de corte', '2016-05-05', 'screen', 1, 'Aviso_de_corte.blade.php', '<p>&nbsp;<img style=\"float: left;\" class=\"\" alt=\"\" src=\"assets/imgeditor/imagenes/thumbnail_CanWisp-1390957114.jpg\" /></p>\n<h1>&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-size: 30px; color: #333333;\" class=\"glyphicon glyphicon-ban-circle\"></span>&nbsp; <strong><span style=\"color: #666699;\">AVISO DE CORTE DE SERVICIO</span></strong></h1>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Estimado (a): {{$cliente}}</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Le comunicamos que su servicio de internet se encuentra suspendido por falta de pago,</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Siendo el vencimiento de la factura el {{$vencimiento}}, del plan {{$plan}} contradado con la empresa,</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Aprox&iacute;mese a nuestras oficinas para para efectuar su pago de {{$costo}} {{$moneda}}, consulte si aplican cargos extra por reconexi&oacute;n.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Realmente no queremos que te quedes sin internet, si esto es incorrecto le pedimos disculpas y le solicitamos</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; que se comunique al n&uacute;mero 800-22721 para aclarar su situaci&oacute;n.</p>\n<p style=\"text-align: center;\"><a class=\"btn btn-primary\" href=\"portal\"><span class=\"glyphicon glyphicon-user\"></span> INGRESAR AL PORTAL</a></p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', 1, '', ''),
